import { Box, Button, Container, Stack } from "@mui/material"
import styles from 'utilities/global_styles.module.css'

const TopBar = () => {
    return (
        <Container maxWidth="lg" style={{ justifyContent: 'space-between', height: "72px", position: "relative", zIndex: 999 }} sx={{ marginTop: "20px", marginBottom: "20px", alignItems: "center", display: "flex" }}>
            <Stack direction="row" alignItems="center">
                <img src="img/app_logo.svg" />
                <Box className={styles.headerTitle} sx={{ marginLeft: 1 }}>Civitas Europe</Box>
            </Stack>
            <Button
                variant="contained" className={styles.actionButtonPrimary}>Download App</Button>
        </Container>
    );
}

export default TopBar
